INSERT INTO `joke` VALUES ('I like frogs.',1,'2014-01-28 19:22:42','2014-01-28 19:22:42'),('There are only 10 kinds of people in the world: those that understand binary, and those that don\'t',2,'2014-01-28 19:26:03','2014-01-28 19:26:03'),('Dad always thought laughter was the best medicine, which I guess is why several of us died of tuberculosis.',3,'2014-01-28 22:41:47','2014-01-28 22:41:47'),('It\'s sad that a family can be torn apart by something as simple as wild dogs.',4,'2014-01-28 22:42:09','2014-01-28 22:42:09'),('Just so you\'re aware, the word \"Saturday\" contains \"turd\".',10,'2014-01-30 22:39:35','2014-01-30 22:39:35'),('funny enough Caturday also contains \"turd\"',11,'2014-01-30 22:59:59','2014-01-30 22:59:59'),('michael keaton to christian bale, they must\'ve gotten... charlie sheen to play spiderman.',12,'2014-05-09 22:15:51','2014-05-09 22:15:51'),('david.dunn: I moved out of a basement. I have no intention of getting back on irc',13,'2014-05-15 21:31:21','2014-05-15 21:31:21'),('I was gonna tell you a joke about UDP but I was afraid you wouldn\'t get it',14,'2014-07-16 17:27:17','2014-07-16 17:27:17'),('If a kid asks where rain comes from, I think a cute thing to tell him is \"God is crying.\" And if he asks why God is crying, another cute thing to tell him is \"Probably because of something you did.\" ',15,'2014-07-16 17:31:42','2014-07-16 17:31:42'),('(tux) > (gates)',16,'2014-07-16 18:21:52','2014-07-16 18:21:52'),('I poured my root beer into a square cup; now it\'s just beer.',20,'2014-07-16 21:11:02','2014-07-16 21:11:02'),('One evening Rene Descartes went to relax at a local tavern. The bar keep approached and said, \"Ah, good evening Monsieur Descartes! Shall I serve you the usual drink?\". Descartes replied, \"I think not.\", and promptly vanished.',21,'2014-07-16 21:15:52','2014-07-16 21:15:52'),('Shawn Mitchell: I should just go afk for the next 7.5 hours before I break anything',22,'2014-07-21 14:35:16','2014-07-21 14:35:16'),('Your d